# Satış verilerini veritabanına ekleyen fonksiyon
def add_sale_to_db(sale_data):
    product, created = Product.objects.get_or_create(
        name=sale_data["name"],
    )

    store, _ = Depot.objects.get_or_create(
        name=sale_data["store"]
    )

    Sale.objects.create(
        store=store,
        product=product,
        quantity=sale_data["quantity"],
        total_amount=sale_data["totalPrice"],
        sale_date=datetime.datetime.strptime(sale_data["date"], "%Y-%m-%d")
    )
    

# Satış verilerini veritabanına ekleme
for sale in sales_data:    
    add_sale_to_db(sale)

print("Satış verileri başarıyla eklendi.")
